import React from 'react';

const AboutMe = () => {
  return (
    <div className="item-card">
      <h2>Welcome to Sustainable Swap Shop!</h2>
      <p>As the brainchild of my Unit 4 project, this platform merges my passion for sustainable living with my technical skills in Django and React. Amidst the fast fashion frenzy, I envisioned a space where users can exchange clothing items, fostering a community committed to reducing environmental impact. Here, users can peruse a diverse array of items, offer their own pieces for exchange, and embark on eco-conscious swaps. Let's join hands in creating a more sustainable future, one swap at a time.</p>
    </div>
  );
};

export default AboutMe;
